// Earth Orbital Animation with Three.js
// Features: 600km altitude, 98¬∞ inclination, sun-pointing orbit

class EarthOrbitSimulation {
    constructor() {
        this.scene = null;
        this.camera = null;
        this.renderer = null;
        this.controls = null;
        this.earth = null;
        this.clouds = null;
        this.cityLights = null;
        this.satellites = [];
        this.orbitPath = null;
        this.numSatellites = 9;
        this.groundStations = [];
        this.groundStationGroup = null;
        
        // Ground station locations (lat, long, name)
        this.groundStationLocations = [
            { lat: 40.7128, lon: -74.0060, name: "New York, USA" },
            { lat: 51.5074, lon: -0.1278, name: "London, UK" },
            { lat: 35.6762, lon: 139.6503, name: "Tokyo, Japan" },
            { lat: -33.8688, lon: 151.2093, name: "Sydney, Australia" },
            { lat: 55.7558, lon: 37.6173, name: "Moscow, Russia" },
            { lat: 19.0760, lon: 72.8777, name: "Mumbai, India" },
            { lat: -23.5505, lon: -46.6333, name: "S√£o Paulo, Brazil" },
            { lat: 30.0444, lon: 31.2357, name: "Cairo, Egypt" },
            { lat: 64.1466, lon: -21.9426, name: "Reykjavik, Iceland" },
            { lat: -34.6037, lon: -58.3816, name: "Buenos Aires, Argentina" },
            { lat: 47.6062, lon: -122.3321, name: "Seattle, USA", color: 0xff8800 } // Orange for testing
        ];
        
        // Physical constants and parameters
        this.EARTH_RADIUS = 6371; // km
        this.SATELLITE_ALTITUDE = 600; // km
        this.ORBITAL_RADIUS = this.EARTH_RADIUS + this.SATELLITE_ALTITUDE; // 6971 km
        this.INCLINATION = 98 * Math.PI / 180; // 98 degrees in radians
        
        // Scale for visualization (1 unit = 1000 km)
        this.SCALE = 1 / 1000;
        this.earthRadius = this.EARTH_RADIUS * this.SCALE;
        this.orbitalRadius = this.ORBITAL_RADIUS * this.SCALE;
        
        // Animation parameters
        this.time = 0;
        this.orbitSpeed = 0.002; // Adjust for visual appeal
        
        this.init();
        this.animate();
    }
    
    init() {
        // Create scene
        this.scene = new THREE.Scene();
        this.scene.background = new THREE.Color(0x000511);
        
        // Create camera
        this.camera = new THREE.PerspectiveCamera(
            75,
            window.innerWidth / window.innerHeight,
            0.1,
            1000
        );
        this.camera.position.set(15, 10, 15);
        
        // Create renderer
        this.renderer = new THREE.WebGLRenderer({ antialias: true });
        this.renderer.setSize(window.innerWidth, window.innerHeight);
        this.renderer.shadowMap.enabled = true;
        this.renderer.shadowMap.type = THREE.PCFSoftShadowMap;
        document.body.appendChild(this.renderer.domElement);
        
        // Add orbit controls
        this.controls = new THREE.OrbitControls(this.camera, this.renderer.domElement);
        this.controls.enableDamping = true;
        this.controls.dampingFactor = 0.05;
        
        this.createEarth();
        this.createSun();
        this.createSatellite();
        this.createGroundStations();
        this.createOrbitPath();
        this.addLighting();
        this.addStars();
        
        // Handle window resize
        window.addEventListener('resize', () => this.onWindowResize(), false);
    }
    
    createEarth() {
        // Create Earth surface with local texture file
        const earthGeometry = new THREE.SphereGeometry(this.earthRadius, 64, 32);
        
        // Create material with fallback blue color
        const earthMaterial = new THREE.MeshPhongMaterial({
            color: 0x151cab, // Fallback blue color
            shininess: 10,
            transparent: false
        });
        
        this.earth = new THREE.Mesh(earthGeometry, earthMaterial);
        this.earth.castShadow = false;
        this.earth.receiveShadow = true;
        this.scene.add(this.earth);
        
        // Try to load texture (will fail with file:// protocol)
        const img = new Image();
        img.crossOrigin = 'anonymous'; // Try to enable CORS
        img.onload = () => {
            console.log('‚úÖ Earth texture loaded successfully');
            const texture = new THREE.Texture(img);
            texture.needsUpdate = true;
            
            // Configure texture mapping for proper geographic alignment
            texture.wrapS = THREE.RepeatWrapping;
            texture.wrapT = THREE.ClampToEdgeWrapping;
            
            // Try different texture offset values to align geography
            // Seattle was in Crimea with 0.25, trying larger shift
            texture.offset.x = 0.82; // Shift horizontally by 75% (270¬∞)
            texture.offset.y = 0.0;  // Shift vertically (latitude alignment)
            
            // You can also try texture.rotation if needed:
            // texture.rotation = Math.PI; // 180 degree rotation
            
            this.earth.material.map = texture;
            this.earth.material.needsUpdate = true;
            console.log('üåç Applied texture with offset (0.25, 0) - adjust as needed');
        };
        img.onerror = () => {
            console.log('‚ùå Cannot load local texture due to CORS policy');
            console.log('');
            console.log('üîß Solutions:');
            console.log('1. Run: chmod +x start_server.sh && ./start_server.sh');
            console.log('   Then open: http://localhost:8000');
            console.log('');
            console.log('2. Use VS Code Live Server extension');
            console.log('');
            console.log('3. Convert image to base64:');
            console.log('   - Open convert_image.html in your browser');
            console.log('   - Convert your texture to base64');
            console.log('   - Replace img.src with the data URL');
            console.log('');
            console.log('üåç Currently showing blue fallback Earth');
        };
        img.src = 'data:image/png;base64,';
        
    }
    
    
    createSun() {
        // Create a distant light source representing the sun
        const sunLight = new THREE.DirectionalLight(0xffffff, 1.5);
        sunLight.position.set(50, 0, 0); // Sun is along positive X axis
        sunLight.castShadow = true;
        sunLight.shadow.mapSize.width = 2048;
        sunLight.shadow.mapSize.height = 2048;
        sunLight.shadow.camera.near = 0.5;
        sunLight.shadow.camera.far = 200;
        sunLight.shadow.camera.left = -20;
        sunLight.shadow.camera.right = 20;
        sunLight.shadow.camera.top = 20;
        sunLight.shadow.camera.bottom = -20;
        this.scene.add(sunLight);
        
        // Add a visual representation of the sun
        const sunGeometry = new THREE.SphereGeometry(2, 16, 16);
        const sunMaterial = new THREE.MeshBasicMaterial({ 
            color: 0xffff00,
            emissive: 0xffaa00
        });
        const sun = new THREE.Mesh(sunGeometry, sunMaterial);
        sun.position.set(50, 0, 0);
        this.scene.add(sun);
    }
    
    createSatellite() {
        const geometry = new THREE.SphereGeometry(0.15, 8, 8); // 50% larger (0.1 * 1.5 = 0.15)
        const material = new THREE.MeshBasicMaterial({ 
            color: 0xffff00,
            emissive: 0xffff00,
            emissiveIntensity: 0.3
        });
        
        // Create 9 satellites equally spaced around the orbit
        for (let i = 0; i < this.numSatellites; i++) {
            const satellite = new THREE.Mesh(geometry, material.clone());
            satellite.castShadow = false;
            this.satellites.push(satellite);
            this.scene.add(satellite);
        }
    }
    
    createGroundStations() {
        // Create a group to hold all ground stations for synchronized rotation
        this.groundStationGroup = new THREE.Group();
        this.scene.add(this.groundStationGroup);
        
        // Create ground stations as colored dots on Earth's surface
        const geometry = new THREE.SphereGeometry(0.08, 8, 8); // Smaller than satellites
        
        this.groundStationLocations.forEach((location, index) => {
            // Use custom color if specified, otherwise default to red
            const color = location.color || 0xff0000;
            const material = new THREE.MeshBasicMaterial({
                color: color,
                emissive: color,
                emissiveIntensity: 0.5
            });
            
            const groundStation = new THREE.Mesh(geometry, material);
            
            // Convert lat/long to 3D coordinates on Earth's surface
            const coords = this.latLongToCartesian(location.lat, location.lon, this.earthRadius + 0.01);
            groundStation.position.set(coords.x, coords.y, coords.z);
            
            // Store reference for debugging
            groundStation.userData = { 
                name: location.name,
                lat: location.lat,
                lon: location.lon,
                index: index,
                color: color
            };
            
            this.groundStations.push(groundStation);
            this.groundStationGroup.add(groundStation); // Add to group instead of scene
        });
        
        console.log(`Created ${this.groundStations.length} ground stations`);
        console.log(`üü† Seattle should appear on the US West Coast at (47.6¬∞N, 122.3¬∞W)`);
    }
    
    latLongToCartesian(lat, lon, radius) {
        // Convert latitude and longitude to Cartesian coordinates
        // lat/lon in degrees, radius in Three.js units
        
        const phi = (90 - lat) * Math.PI / 180; // Polar angle (from north pole)
        const theta = (lon + 180) * Math.PI / 180; // Standard azimuthal angle
        
        const x = radius * Math.sin(phi) * Math.cos(theta);
        const y = radius * Math.cos(phi);
        const z = radius * Math.sin(phi) * Math.sin(theta);
        
        return { x, y, z };
    }
    
    createOrbitPath() {
        const points = [];
        const numPoints = 128;
        
        for (let i = 0; i <= numPoints; i++) {
            const angle = (i / numPoints) * Math.PI * 2;
            
            // Calculate position in orbital plane
            const x = this.orbitalRadius * Math.cos(angle);
            const y = 0;
            const z = this.orbitalRadius * Math.sin(angle);
            
            // Apply inclination rotation around Z-axis (90¬∞ from sun vector)
            // Sun is along X-axis, so orbit plane normal is also along X-axis
            // This creates a polar orbit that's perpendicular to the sun vector
            const rotatedX = x * Math.cos(this.INCLINATION) - y * Math.sin(this.INCLINATION);
            const rotatedY = x * Math.sin(this.INCLINATION) + y * Math.cos(this.INCLINATION);
            
            points.push(new THREE.Vector3(rotatedX, rotatedY, z));
        }
        
        // Create a ribbon-shaped tube instead of a simple line
        const curve = new THREE.CatmullRomCurve3(points);
        curve.closed = true;
        
        const tubeGeometry = new THREE.TubeGeometry(curve, 128, 0.05, 8, true);
        const tubeMaterial = new THREE.MeshPhongMaterial({ 
            color: 0xccaa00, // Dark yellow
            transparent: true,
            opacity: 0.8,
            shininess: 60
        });
        
        this.orbitPath = new THREE.Mesh(tubeGeometry, tubeMaterial);
        this.scene.add(this.orbitPath);
    }
    
    addLighting() {
        // Ambient light for basic visibility
        const ambientLight = new THREE.AmbientLight(0x404040, 0.3);
        this.scene.add(ambientLight);
        
        // Add some rim lighting for Earth
        const rimLight = new THREE.DirectionalLight(0x4488ff, 0.3);
        rimLight.position.set(-50, 0, 0);
        this.scene.add(rimLight);
    }
    
    addStars() {
        const starsGeometry = new THREE.BufferGeometry();
        const starsCount = 1000;
        const positions = new Float32Array(starsCount * 3);
        
        for (let i = 0; i < starsCount * 3; i++) {
            positions[i] = (Math.random() - 0.5) * 200;
        }
        
        starsGeometry.setAttribute('position', new THREE.BufferAttribute(positions, 3));
        
        const starsMaterial = new THREE.PointsMaterial({
            color: 0xffffff,
            size: 0.5
        });
        
        const stars = new THREE.Points(starsGeometry, starsMaterial);
        this.scene.add(stars);
    }
    
    updateSatellitePosition() {
        // Update position for each satellite
        for (let i = 0; i < this.numSatellites; i++) {
            // Calculate orbital position with equal spacing
            const angleOffset = (i / this.numSatellites) * Math.PI * 2; // Equal spacing around orbit
            const angle = this.time * this.orbitSpeed + angleOffset;
            
            // Position in orbital plane
            const x = this.orbitalRadius * Math.cos(angle);
            const y = 0;
            const z = this.orbitalRadius * Math.sin(angle);
            
            // Apply inclination rotation around Z-axis (90¬∞ from sun vector)
            // Sun is along X-axis, so orbit plane normal is also along X-axis
            // This creates a polar orbit that's perpendicular to the sun vector
            const rotatedX = x * Math.cos(this.INCLINATION) - y * Math.sin(this.INCLINATION);
            const rotatedY = x * Math.sin(this.INCLINATION) + y * Math.cos(this.INCLINATION);
            
            this.satellites[i].position.set(rotatedX, rotatedY, z);
        }
    }
    
    animate() {
        requestAnimationFrame(() => this.animate());
        
        this.time += 1;
        
        // Update satellite position
        this.updateSatellitePosition();
        
        // Rotate Earth slowly
        this.earth.rotation.y += 0.005;
        
        // Rotate clouds slightly faster for realism
        if (this.clouds) {
            this.clouds.rotation.y += 0.006;
        }
        
        // Keep city lights synchronized with Earth
        if (this.cityLights) {
            this.cityLights.rotation.y = this.earth.rotation.y;
        }
        
        // Keep ground stations synchronized with Earth rotation
        if (this.groundStationGroup) {
            this.groundStationGroup.rotation.y = this.earth.rotation.y;
        }
        
        // Update controls
        this.controls.update();
        
        // Render scene
        this.renderer.render(this.scene, this.camera);
    }
    
    onWindowResize() {
        this.camera.aspect = window.innerWidth / window.innerHeight;
        this.camera.updateProjectionMatrix();
        this.renderer.setSize(window.innerWidth, window.innerHeight);
    }
}

// Initialize the simulation when the page loads
window.addEventListener('load', () => {
    new EarthOrbitSimulation();
});
